function showOrHideSearchForm(){var e=document.getElementById("searchForm");e.hidden=!e.hidden}function setupPriceRangeSlider(){$("#rangeSlider").slider({range:!0,min:0,max:5e3,values:[0,4e3],slide:function(e,i){$("#minPrice").html("ОТ "+i.values[0]),$("#maxPrice").html("ДО "+i.values[1])}}),$("#minPrice").html("ОТ "+$("#rangeSlider").slider("values",0)),$("#maxPrice").html("ДО "+$("#rangeSlider").slider("values",1))}